(15, 1, '2019-08-15 22:21:36', '2019-08-15 19:21:36', 'Электронная зажигалка - это отличный выбор, если она попадет к мужчине. Любому мужчине придётся по вкусу эта зажигалка не в зависимости от того курит он или нет. Красивый фиолетовый градиент, подчеркнёт брутальность и неотразимость владетеля. Так же она крайне практична, ведь имеет ёмкий аккумулятор, и заряжается от microUSB. Без всяких батареек!', 'Электронная зажигалка', '', 'trash', 'open', 'closed', '', 'electronic-lighters__trashed', '', '', '2019-08-17 17:05:10', '2019-08-17 14:05:10', '', 0, 'https://podaruyimeni.000webhostapp.com/?post_type=product&#038;p=15', 0, 'product', '', 0),
