(35, 1, '2019-08-16 00:01:34', '2019-08-15 21:01:34', 'Электронная зажигалка - это отличный выбор, если она попадет к мужчине. Любому мужчине придётся по вкусу эта зажигалка не в зависимости от того курит он или нет. Красивый фиолетовый градиент, подчеркнёт брутальность и неотразимость владетеля. Так же она крайне практична, ведь имеет ёмкий аккумулятор, и заряжается от microUSB. Без всяких батареек!\n\n.\n\n.\n\n.\n\n.\n\n.\n\n.\n\n.\n\n.\n\n.\n\n.\n\n.\n\n.', 'Электронная зажигалка', '', 'inherit', 'closed', 'closed', '', '15-autosave-v1', '', '', '2019-08-16 00:01:34', '2019-08-15 21:01:34', '', 15, 'https://podaruyimeni.000webhostapp.com/2019/08/15/15-autosave-v1/', 0, 'revision', '', 0),
